import { useNavigate } from "react-router-dom";

function Landing() {
const navigate = useNavigate();

const handleNavigation = () => {
    navigate('/landing')
}

    return (
        <div className="landing">
            <div className="register-box" onClick={handleNavigation}>
                <h3>Register</h3>
            </div>
            <a className="login-box" href="/login">
                <h3>Login</h3>
            </a>
        </div>
    )
}

export default Landing;
